    const searchBox = document.getElementById('searchBox');
    const cardsContainer = document.getElementById('cardsContainer');

    function createCard(robot) {
        const card = document.createElement('div');
        card.classList.add('card');    
        const image = document.createElement('img');
        image.src = robot.image;
        image.alt = robot.name;
        card.appendChild(image);
        const name = document.createElement('h3');
        name.textContent = robot.name;
        card.appendChild(name);
        const username = document.createElement('p');
        username.textContent = `Username: ${robot.username}`;
        card.appendChild(username);

        const email = document.createElement('p');
        email.textContent = `Email: ${robot.email}`;
        card.appendChild(email);

        return card;
    }
    function displayCards(robotArray) {
        cardsContainer.innerHTML = '';
        robotArray.forEach(robot => {
          const card = createCard(robot);
          cardsContainer.appendChild(card);
        });
      }
      
      searchBox.addEventListener('input', () => {
        const searchTerm = searchBox.value.toLowerCase();
        const filteredRobots = robots.filter(robot => robot.name.toLowerCase().includes(searchTerm));
        displayCards(filteredRobots);
      });
      
      // Initial display of all cards
      displayCards(robots);